import subprocess
import base64
import time

def decrypt(data, key):
    length = len(key)
    output = []
    for i in range(len(data)):
        output.append(data[i] & key[i%length])
    return bytes(output)


def get_oracle(raw):
    enc = base64.b64decode(raw.encode("utf-8"))
    assert len(enc) == 14160
    return enc



